const Auth = () => {

  const [isSignedup, setIsSignedup] = useState(false)

  return (
    <>
    <Container component='main' sx={classes.container} fullWidth>
      asas
      <Paper>
        <Grid container xs={12} sm={6}>
          {isSignedup && 
          <>
            {/* <Input name='firstName' label='First Name' type='text'></Input> */}
          </>
          }
          {/* <Input name='email' label='Email' type='email'></Input> */}
        </Grid>
      </Paper>
      
    </Container>

  </>
  )
}

export default Auth
